void SiONVoicePresetUtil::_generate_default_voices() {
	// 16 default voices.

	_begin_category("default");
	_create_basic_voice("sine",      "Sine wave",          0);
	_create_basic_voice("saw",       "Saw wave",           1);
	_create_basic_voice("triangle8", "8bit triangle wave", 3);
	_create_basic_voice("triangle",  "Triangle wave",      4);
	_create_basic_voice("square",    "Square wave",        5);
	_create_basic_voice("noise",     "White noise",        6);
	_create_basic_voice("snoise",    "93bit noise",        25);
	_create_basic_voice("konami",    "Wave table sample",  7);
	_create_basic_voice("ma1",       "MA3 wave sample",    33);
	_create_basic_voice("beep",      "Pulse wave sample",  81);
	_create_basic_voice("ramp",      "Ramp wave sample",   160);

	_create_percussive_voice("bassdrumm", "1 operator bass drum",      0, 63, 28, -128);
	_create_percussive_voice("snare",     "1 operator snare drum",    17, 63, 36, 0, 96, 1);
	_create_percussive_voice("closedhh",  "1 operator closed hi-hat", 19, 63, 40, 0);
	_create_percussive_voice("openedhh",  "1 operator opened hi-hat", 19, 63, 28, 0);
	_create_percussive_voice("crash",     "1 operator crash symbal",  16, 48, 24, 0);

	_create_analog_voice("dualsaw",      "Dual saw",      0, 1, 1, 0, 8);
	_create_analog_voice("dualsquare",   "Dual square",   0, 5, 5, 0, 8);
}

